import { closeModal } from '../../redux/modal/modalSlice';
import { ModalBackdrop, ModalContent } from '../mainModal/MainModal.styled';
import { CloseModalCross } from '../mainModal/CloseModal';
// import { Modal } from '../mainModal/MainModal';   // Remove duplicate import
import { Modal } from './MainModal'; // Corrected import path
import { modalNames } from '../../constant/constant';
import {
  ModalContainer,
  ModalTitle,
  ModalHeader,
} from './EditProfileModal.styled';

const EditProfileModal = () => {
  return (
    <Modal modalId={modalNames.EDIT_PROFILE}>
      <ModalContainer>
        <ModalHeader>
          <ModalTitle>Edit profile</ModalTitle>
          <CloseModalCross />
        </ModalHeader>
      </ModalContainer>
    </Modal>
  );
};

export default EditProfileModal;
